import React, { useState } from "react";
import "./css/SecondMidSec.css";
import engineerMidSec from "./Images/engineer_installation.jpg";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
import ArrowForwardIcon from "@material-ui/icons/ArrowForward";

function SecondMidSec() {
  const [arrowFwdMid, showArrow] = useState(false);
  return (
    <div className="secondMidSec">
      <div className="midsection__info__container">
        <div className="midSection__photo">
          <img src={engineerMidSec} alt="" className="nurseImgMid" />
        </div>
      </div>
      <div className="info__midSec">
        <h1>Best service</h1>
        <p>
          {" "}
          Lorem ipsum dolor sit amet consectetur, adipisicing elit. Illo
          corporis aut eius eveniet maiores dolorem, ab odio ea expedita vel
          voluptas minus hic magni magnam.{" "}
        </p>
        <span
          className="service__link__mid"
          onMouseOver={() => showArrow(true)}
          onMouseOut={() => showArrow(false)}
        >
          Learn More
          {arrowFwdMid ? (
            <ArrowForwardIcon className="midSec__arrowFwd" />
          ) : (
            <ArrowForwardIosIcon className="midSec__arrowFwd" />
          )}
        </span>
      </div>
    </div>
  );
}

export default SecondMidSec;
